def cube_root(n):
    """"""
    if n == 0:
        return 0
    sign = -1 if n < 0 else 1
    n = abs(n)
    low = 0
    high = n
    while low <= high:
        mid = (low + high) // 2
        cube = mid ** 3
        if cube == n:
            return sign * mid
        elif cube < n:
            low = mid + 1
        else:
            high = mid - 1
    return sign * low
